let RealWorldCanvas = function(canvas_width, canvas_height, grid_width, grid_height, sourceImage, landscapeImage) {
  // Create background canvas
  // ------------------------
  // Create the tag
  const backgroundCanvasTag = `<canvas class='background' width='${canvas_width}' height='${canvas_height}' ></canvas>`
  // Append it to the body
  const backgroundCanvas = $(backgroundCanvasTag)[0];
  $(".grids").append(backgroundCanvas);
  // Get the context
  const backgroundContext = backgroundCanvas.getContext("2d");
  // Flip background horizontal
  backgroundContext.translate(0, canvas_width);
  backgroundContext.scale(1, -1);

  // Create obstacle canvas
  // ------------------------
  // Create the tag
  const obstacleCanvasTag = `<canvas class='obstacle' width='${canvas_width}' height='${canvas_height}' ></canvas>`
  // Append it to the body
  const obstacleCanvas = $(obstacleCanvasTag)[0];
  $(".grids").append(obstacleCanvas);
  // Get the context
  const obstacleContext = obstacleCanvas.getContext("2d");
  // Flip obstacles horizontal
  obstacleContext.translate(0, canvas_width);
  obstacleContext.scale(1, -1);

  // Create foreground canvas
  // ------------------------
  // Create the tag
  const foregroundCanvasTag = `<canvas class='real-world' width='${canvas_width}' height='${canvas_height}' ></canvas>`
  // Append it to body
  const foregroundCanvas = $(foregroundCanvasTag)[0];
  $(".grids").append(foregroundCanvas);
  // Get the context
  const foregroundContext = foregroundCanvas.getContext("2d");

  // Create drawing controller
  // -------------------------
  let drawController = new RealWorldVisualization(canvas_width, canvas_height, grid_width, grid_height, foregroundContext, backgroundContext, obstacleContext);

  // Store if the background was already created
  this.hasBackground = false;

  this.render = function(data) {
    drawController.resetCanvas();
    // Only draw background if there is no background
    if (!this.hasBackground) {
      drawController.drawBackground(landscapeImage);
      drawController.drawObstacles(sourceImage);
      this.hasBackground = true;
    }
    drawController.drawForeground(data);
  };

  this.reset = function() {
    drawController.resetCanvas();
  };

};

const RealWorldVisualization = function(height, width, gridWidth, gridHeight, foregroundContext, backgroundContext, obstacleContext) {
  // Find cell size:
  const cellWidth = Math.floor(width / gridWidth);
  const cellHeight = Math.floor(height / gridHeight);

  /*
   * Draw the background image
   */
  this.drawBackground = function(landscapeImage) {
    const that = this;
    maxX = cellWidth * gridWidth;
    maxY = cellHeight * gridHeight;

    // Create image
    const backgroundImage = new Image();
    const backgroundImageFile = `http://127.0.0.1:8521/images/${landscapeImage}`
    // Load the map into the image
    backgroundImage.src = backgroundImageFile;

    // Draw the background image
    backgroundImage.onload = function() {
      // Draw background image
      backgroundContext.drawImage(backgroundImage, 0, 0, width, height);
    };
  };

  /*
   * Draw the obstacle image
   */
  this.drawObstacles = function(sourceImage) {
    const that = this;
    maxX = cellWidth * gridWidth;
    maxY = cellHeight * gridHeight;

    // Create image
    const obstacleImage = new Image();
    const obstacleImageFile = `http://127.0.0.1:8521/images/${sourceImage}`
    // Load the map into the image
    obstacleImage.src = obstacleImageFile;

    // Draw the obstacle image
    obstacleImage.onload = function() {
      // Draw obstacle image
      obstacleContext.drawImage(obstacleImage, 0, 0, width, height);
    };
  };

  /*
   * Draw everything that is related to the foreground (BaseStation, Uav, ...)
   */
  this.drawForeground = function(data) {
    // Draw each altitude seperate to ensure that the agents that are at a
    // higher altitude are drawn on top
    for (let layer in data) {
      this.drawLayer(data[layer]);
    }
  };

  // Calls the appropriate shape(agent)
  this.drawLayer = function(agents) {
    for (let i in agents) {
      let agent = agents[i];
      agent.y = this.convertToCanvas(agent.y)
      if (agent.type == "Uav") {
        this.drawUav(agent.x, agent.y);
        if (agent.item) {
          agent.item[1] = this.convertToCanvas(agent.item[1])
          this.drawItem(agent.item[0], agent.item[1])
        }
      }
      if (agent.type == "BaseStation") {
        this.drawBaseStation(agent.x, agent.y, agent.color);
      }
    }
  };

  // DRAWING METHODS
  // =====================================================================

  /*
   * Draw a BaseStation in the specified grid cell
   * x, y: Grid co-ordinates
   * color: color of the BaseStation
   */
  this.drawBaseStation = function(x, y, color) {
    foregroundContext.beginPath();
    var dx = cellWidth;
    var dy = cellHeight;

    // Keep in the center of the cell:
    var x0 = (x + 0.5) * cellWidth - dx / 2;
    var y0 = (y + 0.5) * cellHeight - dy / 2;

    // Set color
    foregroundContext.strokeStyle = color;
    foregroundContext.fillStyle = color;

    // Draw rectangle
    foregroundContext.fillRect(x0, y0, dx, dy);
  };

  /*
   * Draw a Uav in the specified grid cell
   * x, y: Grid co-ordinates
   */
  this.drawUav = function(x, y) {
     const uavImage = new Image();
     uavImage.src = 'data:image/png;base64,';

     // Calculate position
     const x0 = (x + 0.5) * cellWidth - cellWidth / 1;
     const y0 = (y + 0.5) * cellHeight - cellHeight / 1;

     // Draw image
     uavImage.onload = function() {
       foregroundContext.drawImage(uavImage, x0, y0, cellWidth * 2, cellHeight * 2);
     };
  };

  this.drawItem = function(x, y) {
    foregroundContext.beginPath();
    var dx = cellWidth;
    var dy = cellHeight;

    // Keep in the center of the cell:
    var x0 = (x + 0.5) * cellWidth - dx / 2;
    var y0 = (y + 0.5) * cellHeight - dy / 2;

    // Set color
    foregroundContext.strokeStyle = '#00ff00';
    foregroundContext.fillStyle = '#00ff00';

    // Draw rectangle
    foregroundContext.fillRect(x0, y0, dx, dy);
  };

  /*
   * Reset the canvas
   */
  this.resetCanvas = function() {
    foregroundContext.clearRect(0, 0, width, height);
    foregroundContext.beginPath();
  };

  /*
   * Does the inversion of y positioning because of html5 canvas y direction is from top to bottom
   */
  this.convertToCanvas = function(y) {
    return y
    return gridHeight - y - 1;
  }

}
